import React, { useEffect, useState } from "react";
import axios from "axios";
import { Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Tooltip,
  Legend
);

export default function FarmaciaDashboard() {
  const [data, setData] = useState(null);

  useEffect(() => {
    axios
      .get("http://localhost:8000/api/farmacia")
      .then(res => setData(res.data))
      .catch(err => console.error(err));
  }, []);

  if (!data) return <p>Carregando...</p>;

  /* ===================== GRÃFICO ===================== */
  const meses = [...new Set(data.curvaConsumo.map(i => i.mes))];

  const medicamentos = [...new Set(data.curvaConsumo.map(i => i.medicamento))];

  const datasets = medicamentos.map((med, index) => ({
    label: `${med} - Prescrito`,
    data: meses.map(
      m =>
        data.curvaConsumo.find(
          i => i.medicamento === med && i.mes === m
        )?.prescrito || 0
    ),
    backgroundColor: `rgba(${50 + index * 40}, 99, 200, 0.6)`
  }));

  return (
    <div style={{ maxWidth: 1100, margin: "auto", padding: 20 }}>
      <h1 style={{ textAlign: "center" }}>Dashboard da FarmÃ¡cia</h1>

      {/* ================= KPIs ================= */}
      <h2>ðŸ”´ Estoque abaixo do mÃ­nimo</h2>
      <table border="1" width="100%">
        <thead>
          <tr>
            <th>Medicamento</th>
            <th>Atual</th>
            <th>MÃ­nimo</th>
          </tr>
        </thead>
        <tbody>
          {data.estoqueCritico.map((m, i) => (
            <tr key={i}>
              <td>{m.nome}</td>
              <td>{m.quantidade_atual}</td>
              <td>{m.estoque_minimo}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2 style={{ marginTop: 30 }}>ðŸŸ  PrÃ³ximos do vencimento (30 dias)</h2>
      <table border="1" width="100%">
        <thead>
          <tr>
            <th>Medicamento</th>
            <th>Lote</th>
            <th>Validade</th>
            <th>Qtd</th>
          </tr>
        </thead>
        <tbody>
          {data.vencimentoProximo.map((v, i) => (
            <tr key={i}>
              <td>{v.nome}</td>
              <td>{v.lote}</td>
              <td>{new Date(v.data_validade).toLocaleDateString()}</td>
              <td>{v.quantidade}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2 style={{ marginTop: 40 }}>
        ðŸ“Š Curva de Consumo (Prescrito x Comprado)
      </h2>

      <div style={{ height: 350 }}>
        <Bar
          data={{
            labels: meses,
            datasets
          }}
        />
      </div>
    </div>
  );
}
